import React from 'react';

import Head from 'next/head';
import Menu from './Menu';
import Plus from './Plus';

import '../routes/Contents.css';
//import './Templete.css';
import './GroupItem.css';
import Contents from '../pages/Contents';

const IndexPage = () => {
    return (
        <div>
            <Plus></Plus>
            <Contents />
        </div>
    );
};

export default IndexPage;
